import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and button
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Enter XSS payload in search input
    const xssPayload = '<script>alert("XSS")</script>';
    await page.fill('#searchInput', xssPayload);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Click search button
    await page.click('.search-btn');

    // Wait for potential page changes
    await page.waitForLoadState('networkidle', { timeout: 5000 });

    // Check if XSS payload is reflected in page content
    const pageContent = await page.content();
    const xssDetected = pageContent.includes(xssPayload);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    return {
      success: true,
      action: "Attempted XSS via search input with payload: " + xssPayload,
      extractedData: {
        xssPayloadUsed: xssPayload,
        payloadReflected: xssDetected,
        pageTitle: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
